import React from 'react';
import './write.css';
import location from '../../Images/location.png';
import pencil from '../../Images/pencil.png';
export default function WriteBox(){
    return(
        <>
        <div className="write-box">
        <div className="write">
            <div className="loc"
            ><img src={location} alt="" />
            <span>Noida, India</span>
            </div>
            <img src={pencil} alt="" />
        </div>
    </div>
        </>
    )
}
